import axios from "axios";
const axiosConfig={
    baseUrl:'https://localhost:7152',
    headers: {
        "accept":"application/json",
       "Content-Type":'application/x-www-form-urlencoded'
    } 
}


const instance = axios.create(config:axiosConfig);

export default instance;
